function com()
{

    var comms = document.getElementsByClassName("comment convo clearfix");
    alert(comms.length);
    var names = new Array();
    var fcount = 0;
    var bcount = 0;
    for(var c = 0; c < comms.length; c++)
    {
        var a = comms[c].getElementsByTagName("p");
        if(a.length > 0)
        {
            a = a[0].getElementsByTagName("a");
            if(a.length > 0)
            {
                a = a[0];
                a = a.innerHTML;
                a = a.toUpperCase().split(" ")[0];
                if(girlsnames.indexOf("_"+a+"_") >= 0)
                {
                    fcount++;
                }
                else if(boysnames.indexOf("_"+a+"_") >= 0)
                {
                    bcount++;
                }
            }
        }
    }
    var outp = fcount + " identified female users vs " + bcount + " identified male users";
    outp += "\n" + Math.round(fcount / bcount) + ":1 ratio";
    alert(outp);
}